-- ----------------------------
-- Table structure for npcAIData
-- ----------------------------
DROP TABLE IF EXISTS `npcAIData`;
CREATE TABLE `npcAIData` (
  `npc_id` int(11) NOT NULL DEFAULT '0',
  `skill_chance` int(11) DEFAULT NULL,
  `primary_attack` int(11) DEFAULT NULL,
  `canMove` int(11) DEFAULT NULL,
  `minrangeskill` int(11) DEFAULT NULL,
  `minrangechance` int(11) DEFAULT NULL,
  `maxrangeskill` int(11) DEFAULT NULL,
  `maxrangechance` int(11) DEFAULT NULL,
  `soulshot` int(4) DEFAULT '0',
  `spiritshot` int(4) DEFAULT '0',
  `spschance` int(3) DEFAULT NULL,
  `sschance` int(3) DEFAULT '0',
  `ischaos` int(20) DEFAULT NULL,
  `clan` varchar(40) DEFAULT NULL,
  `enemyRange` int(20) DEFAULT NULL,
  `enemyClan` varchar(20) DEFAULT NULL,
  `dodge` int(3) DEFAULT NULL,
  `ai_type` varchar(8) DEFAULT 'fighter',
  PRIMARY KEY (`npc_id`)
) ENGINE=MyISAM DEFAULT CHARSET=big5;

